    <section class="pb-24 mt-12 px-10 lg:px-20 lg:w-10/12">
        <h2 class="lg:text-xl text-3xl"><b>En sólo 2 minutos ud. entenderá por qué ya tiene que ser parte de nuestros programas de prevención vascular, cardíaca y cerebral...</b></h2>

        <p class="mb-4 mt-12 text-3xl lg:text-base">¿Cuál es la enfermedad más frecuente y que más muertes causa en el mundo?</p>
        <p class="text-3xl lg:text-base">Entre las <b>160.000 personas</b> que mueren todos los días en el planeta por TODAS las causas, <b>50.000 mueren por enfermedad</b> de sus arterias: infarto de corazón, infarto y hemorragia del cerebro, insuficiencia renal, lesión de la arteria aorta y las arterias de las piernas. Es decir <b>UNA TERCERA PARTE</b> de la población mundial muere a causa de la Enfermedad Vascular. <b>El infarto de corazón y cerebro son la primera y segunda causa de muerte en el mundo</b></p>

        <div class="mt-12 flex flex-col gap-12 text-3xl lg:text-base">
            <div class="flex flex-col lg:gap-8 lg:flex-row">
                <div class="w-full lg:w-10/12 relative pt-12">
                    <p class="relative">
                        <img class="absolute -top-12 lg:-top-8 left-0" src="/imgs/icons/quotes-light.svg" alt="">
                        <b>“Yo soy joven, hago ejercicio, no fumo me cuido con la comida y por eso no tengo riesgo de sufrir un infarto de corazón o 
                        <span class="relative">
                            ACV…”
                            <img class="absolute -bottom-3 lg:bottom-0 lg:-bottom-6 rotate-180 -right-16 lg:-right-8" src="/imgs/icons/quotes-light.svg" alt="">    
                        </span></b>
                    </p>
                </div>
                <div class="w-full pt-12">
                    <p>“<b>El 80% de los eventos vasculares</b> (infarto de corazón, cerebro) <b>ocurren</b> en personas de <b>bajo riesgo</b>”. Son precisamente las personas con un exceso de peso moderado, o con colesterol moderadamente elevado, o con un padre que murió antes de los 60 años por infarto, o que fuman o han fumado, las que tomando la población general, <b>representan el mayor número de víctimas de un infarto.</b></p>
                </div>
            </div>
            <div class="flex flex-col lg:gap-8 lg:flex-row">
                <div class="w-full lg:w-10/12 relative pt-12">
                    <p class="relative">
                        <img class="absolute -top-12 lg:-top-8 left-0" src="/imgs/icons/quotes-light.svg" alt="">
                        <b>“Los factores de riesgo para enfermedad vascular son fáciles de detectar pero difíciles de
                            <span class="relative">
                                 controlar…”
                                <img class="absolute -bottom-3 lg:bottom-0 lg:-bottom-6 rotate-180 -right-16 lg:-right-8" src="/imgs/icons/quotes-light.svg" alt="">    
                            </span></b>
                        </b>
                    </p>
